import { FETCH_COURSES, NEW_COURSE } from "./types";

export function fetchCourses() {
  return function (dispatch) {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((res) => res.json())
      .then((courses) =>
        dispatch({
          type: FETCH_COURSES,
          payload: courses,
        })
      );
  };
}
